// React library import
import React, { Component } from 'react';
// Route component import
import { Link, Route, Switch } from 'react-router-dom'
import {BrowserRouter as Router} from 'react-router-dom'
import {Redirect} from 'react-router-dom'
//Pages
import Login from '../login/Login'
import Register from '../register/Register'
import Profile from '../Profile/Profile'
import Pictures from '../../components/pictures/Pictures'
import Favorites from '../Photos/Photos'
import Settings from '../Settings/Settings'

//CSS
import './App.css';


class App extends Component {
  constructor() {
    super();
  }
  render() {

    return (
      <div className="App">
        <div className='App-header-footer'>
        <header>S W I P E &nbsp;&nbsp;&nbsp; R I G H T</header>
        </div> <br/>
        <Router>
          <Switch> 
            <Route exact path='/login'>
              <Login/>
              <div className='login-Wrapper'>
            <Link to='/profile'>Login</Link>
                <form className='login'>
                    Email: <input type='text' name='email'  value={this.state.email} onChange={this.handleChange}></input> <br/>
                    Password: <input id='myPW' type='password' name='password' value={this.state.password} onChange={this.handleChange} ></input>
                </form> <br/>
                <div>
                    <button>Login</button>
                    <button>Submit</button>
                </div>
            </div>
            </Route>
            <Route path='/register'>
              <Register />
            </Route>
          </Switch>
        </Router>
            {/* <Login />
            <Register />
            <Profile />
            <Pictures />
            <Favorites />
            <Settings /> */}
     </div>
    );
  }
}

export default App



